          <div className="translate-y-28 -translate-x-[19.5em] flex items-center gap-2">
        <img src={mlSupWire} width={50} />
        <p className=" text-[#5C837E]">Multilanguage Support</p>
      </div>
        </div>
      );
}

export default LPRightAssets
